description:
Verenigde Staten
Avontuur / Drama
120 minuten

goed

met Paul Walker, Bruce Greenwood en Jason Biggs

Jerry Shepard (Walker), zijn vriend Cooper (Biggs) en een ruwe geoloog (Greenwood) zijn drie leden van een wetenschappelijke 
expeditie op Antarctica. Door een ongeluk en hevige weerscondities zijn ze gedwongen hun team en hun slee-honden achter te laten. 
In de harde winter van Antarctica moeten de honden zes maanden alleen zien te overleven.:
